import React from 'react'
import './Home.css';
import logo from "./img/logo.svg";

function  Home () {
    return (
        <div className="home">
            <div className="home_bg">
                <div header="header d_flex align_items_center pxy_30">
                    <div className="logo">
                        <img src={logo}/>
                    </div>

                </div>
            </div>
        </div>
    )
}

export default Home
